import React from 'react'


const Card = ({name, email, id}) => {
    return (
        <div className="dib bg-light-purple ma3 pa3 shadow=5 br3">
            <img alt="wwwa" src={`https://robohash.org/${id}as`}/>
        <h1>{name}</h1>
        <p>{email}</p>    
        </div>
    )
};

export default Card
